import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'

// 加载 Vant 核心组件库
import { NavBar } from 'vant';



// 加载动态设置 REM 基准值
import 'amfe-flexible'

// 注册使用 Vant 组件库

Vue.use(NavBar);

Vue.config.productionTip = false

new Vue({
    router,
    store,
    render: h => h(App)
}).$mount('#app')
